import React, { Component } from 'react'
import { Timeline } from 'antd';

export default class AboutMe extends Component {

    render() {
       return (
           <div className='timeline'>
            <Timeline>
                <Timeline.Item label="2012-09">Start study in University of South China</Timeline.Item>
                <Timeline.Item label="2016-09">Start study in Concordia University</Timeline.Item>
                <Timeline.Item label="2019-01">Start work in Nuance Communication</Timeline.Item>
                <Timeline.Item label="2021-08">Start work in Manulife</Timeline.Item>
            </Timeline>
        </div>  
        )
    }
}
